long_desc.thetext:
Description of problem: The communication with ccsd is tainted and errors show up in syslog about it. In the worst case clurgmgrd can't make any connection to the cluster and services fail to relocate/activate.
Maybe there are too many connections opened but not closed again.
This error is only reported with Shared Root Clusters and Red Hat support complains about this error.
Version-Release number of selected component (if applicable): latest comoonics productive channel for EL4
How reproducible: Always
Steps to Reproduce: 1. Install OSRC with RHEL/CentOS 4U6 and productive packages 2. # ccs_test connect 3. # ccs_test disconnect <descriptor> 4. Repeat for a little while 5. Examine syslog
Actual results: The following errors rapidly show up in syslog: Jul 7 10:49:18 bldsrv3 ccsd[1586]: Invalid descriptor specified (-111). Jul 7 10:49:18 bldsrv3 ccsd[1586]: Someone may be attempting something evil. Jul 7 10:49:18 bldsrv3 ccsd[1586]: Error while processing get: Invalid request descriptor Jul 7 10:49:18 bldsrv3 ccsd[1586]: Invalid descriptor specified (-41). Jul 7 10:49:18 bldsrv3 ccsd[1586]: Someone may be attempting something evil. Jul 7 10:49:18 bldsrv3 ccsd[1586]: Error while processing disconnect: Invalid request descriptor
And connection will be aborted by ccs_test tool.
Expected results: No error messages and ccsd working as normal. ccs_test tool working all the time.
Additional info:
The following FIX was tested at USM and seems to work perfectly:
#!/bin/bash # # ccsd start/stop ccsd_recreate_ccsd_socket # # chkconfig: 345 20 80 # description: Starts and stops ccsd # # ### BEGIN INIT INFO # Provides: ### END INIT INFO
CCSD_OPTS=
. /etc/init.d/functions [ -f /etc/sysconfig/cluster ] && . /etc/sysconfig/cluster
start() { echo -n "Recreating ccsd socket:" ln -sf $(/opt/atix/comoonics-bootimage/manage_chroot.sh -p)/var/run/cluster/ccsd.sock /var/run/cluster/ccsd.sock ln -sf $(/opt/atix/comoonics-bootimage/manage_chroot.sh -p)/var/run/cluster/ccsd.pid /var/run/cluster/ccsd.pid echo return 0 }
stop() { echo -n "Removing ccsd socket:" rm -f /var/run/cluster/ccsd.sock rm -f /var/run/cluster/ccsd.pid echo return 1 }
rtrn=1
# See how we were called. case "$1" in start) start rtrn=$? ;;
stop) stop rtrn=$? ;;
restart) $0 stop $0 start rtrn=$? ;;
status) status ccsd rtrn=$? ;;
*) echo $"Usage: $0 {start|stop|restart|status}" ;; esac
exit $rtrn

