The idea is as follows.
When additionally using device-mapper-multipath the flexdisks need to have a persistant alias called flexd*. Like can be seen below:
   multipath {
      wwid 0QEMU_QEMU_HARDDISK_drive-scsi0-0-0
      alias flexda
   }

The following patch solves the problem. In cvs as 1.6
