The fixed clvmd needs to be stabilized during cluster startup. This means, that every lvm command inside the initrd has to be stabilized like this:
function exec_local_stabilized {
reps=$1 stime=$2 shift 2
for i in $(seq $reps); do $exec_local $* && break sleep $stime done }
